-- COLOQUE SEU CÓDIGO AQUI

CREATE TABLE MORADOR (
	IDMORADOR INT,
    NOME_MORADOR VARCHAR(100),
    CPF_MORADOR VARCHAR(14),
    BAIRRO VARCHAR(100),
    PRIMARY KEY (IDMORADOR)
    );
    
CREATE TABLE ATENDENTE (
	IDATENDENTE INT,
	NOME_ATENDENTE VARCHAR(100),
    CARGO VARCHAR (50),
    PRIMARY KEY (IDATENDENTE)
    );

CREATE TABLE ATENDIMENTO (
	IDATENDIMENTO INT,
    IDATENDENTE INT,
    IDMORADOR INT,
    DATA_ATENDIMENTO DATE,
    AREA_ATENDIMENTO VARCHAR(100),
    DESCRICAO_ATENDIMENTO TEXT,
    PRIMARY KEY (IDATENDIMENTO),
    FOREIGN KEY (IDATENDENTE) REFERENCES ATENDENTE (IDATENDENTE),
    FOREIGN KEY (IDMORADOR) REFERENCES MORADOR (IDMORADOR)
    );
    
INSERT INTO MORADOR (IDMORADOR, NOME_MORADOR, CPF_MORADOR, BAIRRO)
SELECT DISTINCT IDMORADOR, NOME_MORADOR, CPF_MORADOR, BAIRRO 
FROM PLANILHA_ATENDIMENTO;

INSERT INTO ATENDENTE (IDATENDENTE, NOME_ATENDENTE, CARGO)
SELECT DISTINCT IDATENDENTE, NOME_ATENDENTE, CARGO
FROM PLANILHA_ATENDIMENTO;

INSERT INTO ATENDIMENTO (IDATENDIMENTO, IDATENDENTE, IDMORADOR, DATA_ATENDIMENTO, AREA_ATENDIMENTO, DESCRICAO_ATENDIMENTO)
SELECT DISTINCT ID_ATENDIMENTO, IDATENDENTE, IDMORADOR, DATA_ATENDIMENTO, AREA_ATENDIMENTO, DESCRICAO_ATENDIMENTO
FROM PLANILHA_ATENDIMENTO;